PROCEDURE Proc_MaterialUpdate (IN ms_MaterialId char(36), IN ms_Material json, IN ms_UnitConversion json)
BEGIN

  UPDATE material m
  SET m.MaterialCode = IF(JSON_VALUE(ms_Material, '$.MaterialCode') != 'null', JSON_VALUE(ms_Material, '$.MaterialCode'), NULL),
      m.MaterialName = IF(JSON_VALUE(ms_Material, '$.MaterialName') != 'null', JSON_VALUE(ms_Material, '$.MaterialName'), NULL),
      m.UnitId = IF(JSON_VALUE(ms_Material, '$.UnitId') != 'null', JSON_VALUE(ms_Material, '$.UnitId'), NULL),
      m.StockId = IF(JSON_VALUE(ms_Material, '$.StockId') != 'null', JSON_VALUE(ms_Material, '$.StockId'), NULL),
      m.Expiry = IF(JSON_VALUE(ms_Material, '$.Expiry') != 'null', SUBSTRING((JSON_VALUE(ms_Material, '$.Expiry')), 1, 10), NULL),
      m.MinimumStock = CAST(JSON_VALUE(ms_Material, CONCAT('$.MinimumStock')) AS int),
      m.Description = IF(JSON_VALUE(ms_Material, '$.Description') != 'null', JSON_VALUE(ms_Material, '$.Description'), NULL),
      m.ModifiedDate = NOW()
  WHERE m.MaterialId = ms_MaterialId;

  CREATE TEMPORARY TABLE TempUnitConversions (
    UnitConversionId char(36) NOT NULL,
    UnitId char(36) DEFAULT NULL,
    MaterialId char(36) DEFAULT NULL,
    ConversionRate int(11) DEFAULT NULL,
    Calculation int(11) DEFAULT NULL,
    Mode int(11) DEFAULT NULL
  );

    SELECT
      JSON_VALUE(ms_UnitConversion, CONCAT('$[', n.number, '].UnitConversionId')) AS UnitConversionId,
      IF(JSON_VALUE(ms_UnitConversion, CONCAT('$[', n.number, '].UnitId')) != 'null', JSON_VALUE(ms_UnitConversion, CONCAT('$[', n.number, '].UnitId')), NULL) AS UnitId,
      @materialId,
      IF(JSON_VALUE(ms_UnitConversion, CONCAT('$[', n.number, '].ConversionRate')) != 'null', JSON_VALUE(ms_UnitConversion, CONCAT('$[', n.number, '].ConversionRate')), NULL) AS ConversionRate,
      IF(JSON_VALUE(ms_UnitConversion, CONCAT('$[', n.number, '].Calculation')) != 'null', JSON_VALUE(ms_UnitConversion, CONCAT('$[', n.number, '].Calculation')), NULL) AS Calculation,
      JSON_VALUE(ms_UnitConversion, CONCAT('$[', n.number, '].Mode')) AS Mode
    FROM number n
    WHERE n.number < JSON_LENGTH(ms_UnitConversion);

  # Thêm mới
    SELECT
      UUID(),
      tuc.UnitId,
      ms_MaterialId,
      tuc.ConversionRate,
      tuc.Calculation,
      NOW()
    FROM TempUnitConversions tuc
    WHERE tuc.Mode = 1;

  # Sửa
  UPDATE unitconversion u
  JOIN TempUnitConversions tuc
    ON u.UnitConversionId = tuc.UnitConversionId
  SET u.UnitId = tuc.UnitId,
      u.ConversionRate = tuc.ConversionRate,
      u.Calculation = tuc.Calculation
  WHERE tuc.Mode = 2;

  #Xóa
  DELETE
    FROM unitconversion
  WHERE EXISTS (SELECT
        1
      FROM TempUnitConversions tuc
      WHERE unitconversion.UnitConversionId = tuc.UnitConversionId
      AND tuc.Mode = 3);

  DROP TEMPORARY TABLE IF EXISTS TempUnitConversions;

END
