--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE Proc_MaterialGetPagging(IN ms_PageSize INT, IN ms_Skip INT, IN ms_MaterialFilter VARCHAR(255), OUT ms_TotalRecord INT)
BEGIN
  SET @sql = CONCAT('SELECT count INTO @TotalRecord FROM (SELECT COUNT(1) count FROM material m WHERE 1 = 1 ', ms_MaterialFilter,') as tb;');
  PREPARE stmt FROM @sql;
  EXECUTE stmt;
  DEALLOCATE PREPARE stmt;
  
  SET ms_TotalRecord := @ToTalRecord;
  SET @sql = CONCAT(' SELECT m.*, s.DataName AS UnitName, s1.DataName AS StockName
                      FROM material m LEFT JOIN systemmasterdata s ON m.UnitId = s.DataId 
                                    LEFT JOIN systemmasterdata s1 ON m.StockId = s1.DataId
                      WHERE 1 = 1 ', ms_MaterialFilter,'
                      ORDER BY m.CreatedDate DESC LIMIT ? OFFSET ?;');
  
  PREPARE stmt FROM @sql;
  EXECUTE stmt USING ms_PageSize, ms_Skip;
  DEALLOCATE PREPARE stmt;
END
$$

